Mongoaudit is a CLI tool for auditing MongoDB #servers, detecting poor #security settings and performing automated penetration testing.

Supported tests:

1. MongoDB listens on a port different to default one
2. The server only accepts connections from whitelisted hosts/networks
3. MongoDB HTTP status interface is not accessible on port 28017
4. MongoDB is not exposing its version number
5. MongoDB version is newer than 2.4
6. TLS/SSL encryption is enabled
7. Authentication is enabled
8. The SCRAM-SHA-1 authentication method is enabled
9. Server-side #Javascript is forbidden *
10. Roles granted to the user only permit CRUD operations *
11. The user has permissions over a single database *
